If(dataIn_en._eq(1) & wr_ptr._eq(14),
    looped_next(1)
).Elif(dataOut_en._eq(1) & rd_ptr._eq(14),
    looped_next(0)
).Else(
    looped_next(looped)
)

If(fifo_read._eq(1),
    If((~fifo_write)._eq(1),
        size_reg_next(size_reg - 1)
    ).Else(
        size_reg_next(size_reg)
    )
).Elif(fifo_write._eq(1),
    size_reg_next(size_reg + 1)
).Else(
    size_reg_next(size_reg)
)

If(wr_ptr._eq(rd_ptr),
    If(looped._eq(1),
        dataIn_wait(1),
        dataOut_wait(0)
    ).Else(
        dataOut_wait(1),
        dataIn_wait(0)
    )
).Else(
    dataIn_wait(0),
    dataOut_wait(0)
)

If(st._eq(st_t.waitOnAck) & reqAckHasCome._eq(1),
    uploadedCntr_next((uploadedCntr._reinterpret_cast(Bits(16, signed=False)) + Concat(Bits(11).from_py(0), sizeOfItems)._reinterpret_cast(Bits(16, signed=False)))._reinterpret_cast(Bits(16)))
).Else(
    uploadedCntr_next(uploadedCntr)
)

If(st._eq(st_t.waitOnInput) & (sig_buff_size._eq(16) | timeoutCntr._eq(0)) & wDatapump_req_rd._eq(1),
    lastWordCntr_next(sizeTmp)
).Elif((lastWordCntr != 0) & (wDatapump_w_ready & sig_buff_dataOut_vld)._eq(1),
    lastWordCntr_next(lastWordCntr - 1)
).Else(
    lastWordCntr_next(lastWordCntr)
)

Switch(st)\
    .Case(st_t.waitOnInput,
        If((sig_buff_size._eq(16) | timeoutCntr._eq(0)) & wDatapump_req_rd._eq(1),
            st_next(st_t.waitOnDataTx)
        ).Else(
            st_next(st)
        ))\
    .Case(st_t.waitOnDataTx,
        If(lastWordCntr._eq(1) & (wDatapump_w_ready & sig_buff_dataOut_vld)._eq(1),
            st_next(st_t.waitOnAck)
        ).Else(
            st_next(st)
        ))\
    .Default(
        If(reqAckHasCome._eq(1),
            st_next(st_t.waitOnInput)
        ).Else(
            st_next(st)
        ))
